            def create_ip_range(start_ip, end_ip):
                start = list(map(int, start_ip.split('.')))
                end = list(map(int, end_ip.split('.')))
                temp = start[:]
                ip_range = []

                while temp != end:
                    ip_range.append('.'.join(map(str, temp)))
                    temp[3] += 1
                    for i2 in (3, 2, 1):
                        if temp[i2] == 256:
                            temp[i2] = 0
                            temp[i2-1] += 1
                ip_range.append(end_ip)
                return ip_range
            

